import React from "react";

//components

//styled
import { ServiceSessionsContainer,ServiceWrapper,ServiceWrapperItem } from "./ServiceStyle";
import {
  SessionDescription,
  SessionHeader,
  Sessionsrate,
  SessionsNametwo,
  SessionName,
  SessionsTitle,
  TestimonialSessionsContainerDes,
  TestimonialSessionsContainer,
  TestimonialSessionsContainerFirst,
  TestimonialSessionsContainerImg,
} from "../Testimonial/TestimonialStyle";
import { ButtonStyle } from "../Button/LinkStyle";

const WhySection = () => {
  return (
    <ServiceSessionsContainer>
      <SessionsTitle>Testimonials</SessionsTitle>
      <SessionHeader>What customers say about us?</SessionHeader>
      <ServiceWrapper>
          <ServiceWrapperItem>
              <SessionName>Janitorial Service</SessionName>
              <TestimonialSessionsContainerDes>We're ready to provide a regular cleaning tasks that keep your business looking great on a regular basis. Whether you need nightly janitorial services or only need cleanings a few times a month, our trained  cleaners can work with you </TestimonialSessionsContainerDes>
          </ServiceWrapperItem>
          <ServiceWrapperItem>1</ServiceWrapperItem>
          <ServiceWrapperItem>1</ServiceWrapperItem>
          <ServiceWrapperItem>1</ServiceWrapperItem>
          <ServiceWrapperItem>1</ServiceWrapperItem>
          <ServiceWrapperItem>1</ServiceWrapperItem>
          <ServiceWrapperItem>1</ServiceWrapperItem>
      </ServiceWrapper>
    </ServiceSessionsContainer>
  );
};

export default WhySection;
